/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `registrar_historial_jefe` BEFORE UPDATE ON `empleado` FOR EACH ROW BEGIN
    -- Verificar si el campo idJefe está cambiando de un valor a NULL
    IF OLD.Jefe_idEmpleado IS NOT NULL THEN
        -- Insertar el registro en la tabla historial_jefes
        INSERT INTO historial_promociones_jefe
        VALUES (
        	OLD.idEmpleado,
			OLD.Nombre,
			OLD.Email,
			OLD.Salario,
			OLD.Tipo,
			OLD.Stack,
			OLD.Departamento_idDepartamento,
			OLD.Jefe_idEmpleado,
			CURRENT_TIMESTAMP);
    END IF;
END */;;
